css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("acronymsearch.com") {
 body
  {
    background-color: #222 !important;
  }
 img[src="acronym_logo.gif"]
  {
    background:
      url(data:image/png;base64,)
      !important;
    padding-left: 275px !important;
    padding-top: 30px !important;
    height: 0 !important;
    width: 0 !important;
  }

 a:link,
 a:visited,
 a:link,
 a:visited
  {
    color: #918E80 !important;
  }

 a:active,
 a:hover,
 a:active,
 a:hover
  {
    color: #E8E1BD !important;
  }

 font
  {
    color: #ccc !important;
  }

 #content
  {
    background-color: #302F2C !important;
    border-bottom: 1px solid #000 !important;
    border-left: 1px solid #000 !important;
    border-top: 1px solid #000 !important;
    color: #ccc !important;
  }
 #menu
  {
    background: none !important;
    color: #ccc !important;
  }

 #bookmark
  {
    display: none !important;
  }

 td[width="140"]
  {
    overflow: hidden !important;
    width: 0 !important;
  }

 tr[style="background-color: rgb(217, 217, 255);"]
  {
    background-color: #2B2F2B !important;
    color: #ccc !important;
  }

 tr[style="background-color: rgb(232, 232, 255);"]
  {
    background-color: #262C2D !important;
    color: #ccc !important;
  }

 table[border="1"],
 table[border="1"] td,
 tr[style="background-color: rgb(217, 217, 255);"] > td,
 tr[style="background-color: rgb(232, 232, 255);"] > td
  {
    border: 1px solid #111 !important;
  }


}
